webpackJsonp([0xf9c6c99de3e9],{494:function(i,n){i.exports={data:{markdownRemark:{html:'<p>Not so long ago, this project got ported to v1 version of GatsbyJS.</p>\n<blockquote class="twitter-tweet" data-lang="en"><p lang="en" dir="ltr">Great news! Gatsby Material starter is now based on stable V1 of <a href="https://twitter.com/gatsbyjs">@gatsbyjs</a>!<a href="https://t.co/P2JqNbcRmk">https://t.co/P2JqNbcRmk</a></p>&mdash; Ruben Harutyunyan (@Vagr9K) <a href="https://twitter.com/Vagr9K/status/883073085963993089">July 6, 2017</a></blockquote>\n<p>And now, it\'s super exciting for me to announce the <code>v1.1</code> version of <code>Gatsby Material Starter</code>!</p>\n<p>You can also visit <a href="https://vagr9k.me">my personal blog</a> if you want to see a fully implemented blog based on this starter.</p>\n<p>New features are:</p>\n<ul>\n<li>Suggested posts segment</li>\n<li>\n<p>Development tools</p>\n<ul>\n<li>ESLint for linting</li>\n<li>Prettier for code style</li>\n<li>Remark-Lint for linting Markdown</li>\n<li>write-good for linting English prose</li>\n<li>gh-pages for deploying to GitHub pages</li>\n<li>CodeClimate configuration file and badge</li>\n</ul>\n</li>\n</ul>\n<p>Full feature list:</p>\n<ul>\n<li>Blazing fast loading times thanks to pre-rendered HTML and automatic chunk loading of JS files</li>\n<li>\n<p><a href="https://github.com/mlaursen/react-md">React-MD</a> for Material design</p>\n<ul>\n<li>Integrated FontAwesome support</li>\n<li>Integrated Material Icons support</li>\n</ul>\n</li>\n<li>SASS/SCSS styling</li>\n<li>Separate components for everything</li>\n<li>\n<p>High configurability:</p>\n<ul>\n<li>User information</li>\n<li>User social profiles</li>\n<li>Copyright information</li>\n<li>More!</li>\n</ul>\n</li>\n<li>\n<p>Author segment</p>\n<ul>\n<li>Name</li>\n<li>Location</li>\n<li>Description</li>\n<li>Links</li>\n<li>Follow Me button</li>\n</ul>\n</li>\n<li>\n<p>Posts in Markdown</p>\n<ul>\n<li>Code syntax highlighting</li>\n<li>Embedded YouTube videos</li>\n<li>Embedded Tweets</li>\n</ul>\n</li>\n<li>\n<p>Tags</p>\n<ul>\n<li>Seprate page for posts under each tag</li>\n</ul>\n</li>\n<li>\n<p>Categories</p>\n<ul>\n<li>Separate page for posts under each category</li>\n</ul>\n</li>\n<li>Suggested posts segment</li>\n<li>\n<p>Disqus support</p>\n<ul>\n<li>Notifications about new disqus comments</li>\n</ul>\n</li>\n<li>Google Analytics support</li>\n<li>\n<p>Responsive design</p>\n<ul>\n<li>On mobile, Disqus is loaded only after expanding comments for better performance</li>\n</ul>\n</li>\n<li>\n<p>Social features</p>\n<ul>\n<li>Twitter tweet button</li>\n<li>Facebook share/share count</li>\n<li>Reddit share/share count</li>\n<li>Google+ share button</li>\n<li>LinkedIn share button</li>\n<li>Telegram share button</li>\n</ul>\n</li>\n<li>\n<p>SEO</p>\n<ul>\n<li>Sitemap generation</li>\n<li>robots.txt</li>\n<li>General description tags</li>\n<li>Schema.org JSONLD (Google Rich Snippets)</li>\n<li>OpenGraph Tags (Facebook/Google+/Pinterest)</li>\n<li>Twitter Tags (Twitter Cards)</li>\n</ul>\n</li>\n<li>RSS feeds</li>\n<li>Loading progress for slow networks</li>\n<li>Offline support</li>\n<li>Web App Manifest support</li>\n<li>\n<p>Development tools</p>\n<ul>\n<li>ESLint for linting</li>\n<li>Prettier for code style</li>\n<li>Remark-Lint for linting Markdown</li>\n<li>write-good for linting English prose</li>\n<li>gh-pages for deploying to GitHub pages</li>\n<li>CodeClimate configuration file and badge</li>\n</ul>\n</li>\n</ul>\n<p>NOTE: Take a look at <a href="https://github.com/Vagr9K/gatsby-advanced-starter">gatsby-advanced-starter</a> if you prefer building UI from scratch and/or only interested in fundamental features.</p>\n<p>More information is available on <a href="https://github.com/Vagr9K/gatsby-material-starter">GitHub repository page</a>.</p>',timeToRead:2,excerpt:"Not so long ago, this project got ported to v1 version of GatsbyJS. And now, it's super exciting for me to announce the  v1.1  version ofâ€¦",frontmatter:{title:"Introducing Gatsby Material Starter",cover:"/logos/logo-1024.png",date:"18/07/2017",category:"gatsby",tags:["gatsby","material","starter"]},fields:{nextTitle:"Bold Mage",nextSlug:"/bold-mage",prevTitle:"Birch in the Roses",prevSlug:"/birch-in-the-roses",slug:"/introducing-gatsby-material-starter"}}},pathContext:{slug:"/introducing-gatsby-material-starter"}}}});
